description:
Kennex and Dorian respond to a suspicious death at a hospital where - before having a fatal cardiac arrest - a man claimed someone was trying to kill him, and inexplicably knew his exact time of death. As the investigation unfolds, a black market for vital organs is uncovered in which bio-mechanical hearts can be resold and remotely &quot;shut off.&quot; As the team fights to find the pulse of this 2048 tech-centric crime, Dorian reconnects with a decommissioned DRN.

